      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 / col1 BETWEEN + col2 AND - + col2 * + + col0 * + + col2 - col1 * + col0;
  - name: tab1

outputs:
